import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';

export default function HotDogPage() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [previewUrl, setPreviewUrl] = useState(null);
  const [result, setResult] = useState(null);
  const [isLoading, setIsLoading] = useState(false);

  const handleFileChange = (event) => {
    const file = event.target.files[0];
    setSelectedFile(file);
    setPreviewUrl(URL.createObjectURL(file));
    setResult(null);
  };

  const handleDetectClick = async () => {
    if (!selectedFile) return;
    setIsLoading(true);
    const formData = new FormData();
    formData.append('image', selectedFile);
    try {
      const res = await axios.post('http://localhost:3002/api/detect', formData);
      setResult(res.data.result);
    } catch (error) {
      console.error(error);
    } finally {
      setIsLoading(false);
    }
  };

  const predefinedImages = [
    { label: "Hot Dog", src: "/images/hotdog.jpg" },
    { label: "Banana", src: "/images/banana.jpg" },
    { label: "Car", src: "/images/car.jpg" },
    { label: "Elephant", src: "/images/elephant.jpg" },
  ];

  const handlePredefinedClick = (imagePath) => {
    fetch(imagePath)
      .then((res) => res.blob())
      .then((blob) => {
        const file = new File([blob], imagePath.split('/').pop(), { type: blob.type });
        setSelectedFile(file);
        setPreviewUrl(URL.createObjectURL(blob));
        setResult(null);
      });
  };

  return (
    <div className="hotdogpage relative">
      <input type="file" onChange={handleFileChange} className="mb-4" />

      <table border={1} align="center">
        <tbody>
          <tr>
            <td className="container">
              {previewUrl && (
                <div>
                  <img 
                    align="center" 
                    src={previewUrl} 
                    alt="Preview" 
                    className="my-4-selected object-contain"
                  />
                  <div className="overlay">
                    {result === "Hot Dog" ? (
                      <>
                        <img src="/images/checkmark.png" alt="Definitely a Hot Dog" />
                        <div className="result-hotdog">Hot Dog!!!</div>
                      </>
                    ) : result === "Not Hot Dog" ? (
                      <>
                        <img src="/images/redx.png" alt="Sorry, not a Hot Dog" />
                        <div className="result-nothotdog">Not Hot Dog!</div>
                      </>
                    ) : null}
                  </div>
                </div>
              )}
            </td>
          </tr>
          <tr>
            <td>
              <button 
                onClick={handleDetectClick} 
                className="mt-4 bg-green-500 text-white py-2 px-4 rounded"
              >
                Detect
              </button>
            </td>
          </tr>
        </tbody>
      </table>

      <div className="flex justify-center gap-4 mt-6">
        {predefinedImages.map(img => (
          <img 
            key={img.label} 
            src={img.src} 
            alt={img.label} 
            className="mythumbs h-[100px] object-cover cursor-pointer" 
            onClick={() => handlePredefinedClick(img.src)} 
          />
        ))}
      </div>

      {isLoading && (
        <div className="spinner-overlay fixed top-0 left-0 w-full h-full flex items-center justify-center bg-gray-700 bg-opacity-50 z-50">
          <div className="spinner">
            <svg className="animate-spin h-12 w-12 text-white" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 4 4">
              <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
              <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8v8H4z"></path>
            </svg>
          </div>
        </div>
      )}
    </div>
  );
}
